String poiSvg(String type) {
  final emojiEntry = emojiMap.firstWhere(
    (entry) => entry['types'].contains(type),
    orElse: () => defaultIcon,
  );
  return emojiEntry['svg'];
}

String poiEmoji(String type) {
  final emojiEntry = emojiMap.firstWhere(
    (entry) => entry['types'].contains(type),
    orElse: () => defaultIcon,
  );
  return emojiEntry['emoji'];
}

String emojiSvg(String emoji) {
  final emojiEntry = emojiMap.firstWhere(
    (entry) => entry['emoji'] == emoji,
    orElse: () => defaultIcon,
  );
  return emojiEntry['svg'];
}
